	public class WalletHelper
	{
		static List<string> _WalletProducts;

		public static List<string> GetWalletProducts()
		{
			if (_WalletProducts == null)
			{
				_WalletProducts = new List<string>();
				_WalletProducts.Add("btc");
				_WalletProducts.Add("eth");
				_WalletProducts.Add("xdc");
				_WalletProducts.Add("dag");
			}

			return _WalletProducts;

		}

	}

	public class ERCHelper
	{

		static List<KnownCurrencies> _Currencies;

		static Dictionary<string, KnownCurrencies> _Dictionary;

		public static KnownCurrencies GetKnownCurrency(string Contract)
		{
			try
			{
				if (_Currencies == null)
				{
					_Currencies = JsonConvert.DeserializeObject<List<KnownCurrencies>>(Encoding.UTF8.GetString(Convert.FromBase64String(KnownAssets)));

					_Dictionary = new Dictionary<string, KnownCurrencies>();

					foreach (var c in _Currencies)
					{
						_Dictionary.TryAdd(c.contractAddress.ToLower().Trim(), c);
					}
				}

				if (_Dictionary.ContainsKey(Contract.ToLower()))
					return _Dictionary[Contract.ToLower()];
			}
			catch { }
			return null;

		}

		const string KnownAssets = "";

	}

